import React from 'react';
import Stack from '@mui/material/Stack';
import './DataCenter.css'


function DataMaster(){
    return(
        <div>
            <DataFaceDetection/>
        </div>
    )
}
function DataFaceDetection(){
    return(
        <div style={{textAlign: 'center'}}>
            <p style={{fontSize: '26px'}}>Relevant Faces Detected</p>
        </div>
    )
}
function DataPanels(){
    return(
    <Stack direction="column" justifyContent="center" alignItems="flex-start">
    <div className="buttonParent">
    <p className="button"><a href="/AdminPanel">Home</a></p>
    <p className="button"><a href="/Cameras">Control Center</a></p>
    <p className="button"><a href="/DataCenter">Data Center</a></p>
    <p className="button"><a href="/Settings">Settings</a></p>
    </div>   
    </Stack>)
}
export default DataMaster;
